query MovieTemplate(
  $id: String!
) {
  strapiMovie(id: {eq: $id}) {
    name
    description
    rating
    year
    poster
  }
}

query IndexQuery {
  allStrapiMovie {
    edges {
      node {
        id
        poster
        name
        description
        rating
      }
    }
  }
}

